        <script>
            function typewriterEffect(text, elementId, interval = 50) {
                let i = 0;
                const element = document.getElementById(elementId);

                function type() {
                    if (i < text.length) {
                        element.innerHTML += text.charAt(i);
                        i++;
                        setTimeout(type, interval);
                    }
                }

                type();
            }

